import './places.css'; // Import the CSS file

interface TourPackage {
  name: string;
  rate: string;
  description: string;
  imageUrl: string;
  tripOutline: string;
  tripInstruction: string;
  tripIncludes: string;

}

const ContactCardList = () => {
  // Static data for demonstration
  const [data, setData] = useState<TourPackage[]>([]);
